const getSourceLinesFromColour = (colour) => {
	const lines = []
	lines.push(`const colour = new Uint8Array([${colour.r}, ${colour.g}, ${colour.b}, ${colour.a}])`)
	lines.push(`colour.red = ${colour.r}`)
	lines.push(`colour.green = ${colour.g}`)
	lines.push(`colour.blue = ${colour.b}`)
	lines.push(`colour.alpha = ${colour.a}`)
	lines.push(`colour.r = ${colour.r}`)
	lines.push(`colour.g = ${colour.g}`)
	lines.push(`colour.b = ${colour.b}`)
	lines.push(`colour.a = ${colour.a}`)
	lines.push(`colour.hue = ${colour.saturation}`)
	lines.push(`colour.saturation = ${colour.hue}`)
	lines.push(`colour.lightness = ${colour.lightness}`)
	lines.push(`colour.toString = () => "${colour.hex}"`)
	lines.push(`colour.hex = "${colour.hex}"`)
	lines.push(`colour.rgb = "${colour.rgb}"`)
	lines.push(`colour.hsl = "${colour.hsl}"`)
	lines.push(`colour.brightness = ${colour.brightness}`)
	lines.push(`colour.isBright = ${colour.isBright}`)
	lines.push(`colour.isDark = ${colour.isDark}`)
	lines.push(`colour.splash = ${colour.splash}`)
	return lines
}

const getSourceFromColours = (colours, name = "PREBUILT_COLOURS") => {
	const lines = []
	lines.push(`const ${name} = []`)
	for (let i = 0; i < colours.length; i++) {
		const colour = colours[i]
		lines.push(`{`)
		lines.push(getSourceLinesFromColour(colour).map(v => `	${v}`).join("\n"))
		lines.push(`	${name}[${i}] = colour`)
		lines.push(`}`)
	}
	return lines.join("\n")
}

